import React from "react";
interface IProps {
  inputRow: string;
  outputRow: string;
  className: String;
}
export const Rotor: React.FC<IProps> = ({ inputRow, outputRow, className }) => {
  return (
    <div className="well">
      <tbody>
        <table>
          <tr>
            {inputRow.split("").map((character: string) => (
              <td className={`td ${className} forwardPassLightUp`}>
                {character}
              </td>
            ))}
          </tr>
        </table>
      </tbody>
    </div>
  );
};
